import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://octodex.github.com/images/Professortocat_v2.png" className="App-logo" alt="logo" />
        <p>
         <code>Capco</code>
        </p>
        Engineering Framework
      </header>
    </div>
  );
}

export default App;
